	('d80961e7a617', '<p>- Keine Energy Drinks, Alkohol, Zigaretten etc.</p><p>- Einander zuhren</p><p>- Die Leiter respektieren so wie auch die anderen Teilnehmer respektieren.</p><p>- Nachtruhe einhalten.</p><p>- Der Lagerplatz nicht verlassen</p><p>- Fr Schanzmatt Material immer ein Leiter fragen</p><p>- Kein Mobbing</p>'),
