	('0e9f487ca35a', '<p>Wir machen uns auf den Weg ins Hogwarts-Sommer-Camp.</p>'),
	('8b967bf8d778', '<p>Velomechs auf der <strong>Strecke</strong>:</p><ul><li><p>Velos - Motos Ryser, Musterdorf, 077 123 45 67</p></li><li><p>Radprofi Weibel, Ennetda, 021 123 45 67</p></li></ul>'),
	('05fd1a6276a0', '<p>Ein Sommercamp baut sich nicht von alleine auf -&gt; das tun wir jetzt.</p>'),
	('283a58df7d9b', '<p>Die Teilnehmer erreichen Das Hogwarts-Sommercamp und erfahren dessen wahre Bedeutung - wir wollen Harry''s Horkruxe zerstren und ihn so wieder zu dem liebenswerten Zauberer machen, den wir alle kennen und lieben. Denn seit dem Ende der Buchserie ist einige Zeit vergangen und Harry ist der Erfolg zu Kopf gestiegen. Schtig nach Macht hat auch er, wahrscheinlich durch die hinterlassenen Spuren des Daseins als Voldemort''s Horkrux, sieben Horkruxe erschaffen. Unsere Aufgabe ist es nun, diese zu finden und zu zerstren, so dass Harry''s Seele wieder ganz wird. Da wir offiziell aber natrlich das Image des Hogwarts-Sommercamps aufrecht erhalten mssen, werden die Teilnehmer in vier Huser aufgeteilt (20 TN --&gt; 4 Gruppen  5). Dies sind die Zeltgruppen und in ihnen knnen die TN Punkte fr ihre Huser sammeln indem sie z.B. das erste komplett anwesende Zelt sind wenn es pfeift etc. Die Hogwarts-Huser competition wird also auch in unserem "Sommercamp" weitergefhrt. Leiter des Camps is Albus Potter, Harry''s Sohn.</p><p>Die Figuren stellen sich vor: Hauslehrer</p><p>Farfalla: Gryffindor</p><p>Castor: Slytherin</p><p>Biber: Ravenclaw</p><p>Salamander: Hufflepuff</p><p>Adler: Filch</p><p>Pandora: Irgende WEasly</p><p>Weiter mgliche Personen:</p><p>Albus Potter, Ted Lupin, Rose oder Hugo Weasly, Scorpius Malfoy, Swagrid</p><p>Allgemeine Dinge ber das Harry Potter universum werden erzhlt:</p><p>- huser, Hogwarts, verbotener wald, zaubersprche, das ministerium, spezielle wesen wie zentauren phnix etc., denkarium..?</p>'),
	('651220bcea22', '<p>Zum die Horkrux zu sammeln mssen wir zusammen halten. Dadurch spielen wir verschiedene Spiele um uns besser kennen zu lernen.</p>'),
	('a70a441e44d0', '<p>Apotheke mitnehmen</p>'),
	('063244de52d6', '<p>Damit wir herausfinden, warum Harry bse wurde, mssen wir uns in seine Rolle versetzen, bevor er bse wurde. In Hogwarts gibt es verschiedene Gestalten, in die wir uns vertiefen wollen.</p>'),
	('6fa0ee230602', '<p>Die ganze Erklrung des Games auf externem Sheet.</p>'),
	('8ec651d8892c', ''),
	('ea63d22b8898', '<p>In unserem Sommercamp brauchen wir Regeln, wie es sie in Hogwarts auch gibt (nicht in den Verbotenen Wald etc.) Deshalb machen wir uns nun daran, diese Regeln festzulegen.</p>'),
	('a2949c251d61', ''),
	('886f1428cadd', '<p>Jeder Zauber braucht eine Spezialfhigkeit. Die hier angebotenen sind besonders wichtig im Kampf gegen Horkruxe, deshalb bentigen wir Experten auf jedem der Gebiete. Quasi Wahlfach des Sommercamps</p>'),
	('6c0e4b006607', NULL),
	('1380618e31e7', '<p>cooler roter Faden</p>'),
	('075967d2dd93', '<p>jhasjkdhaskjdhasdas</p>'),
	('6f71f73439cf', ''),
	('b76e3ea5d4a8', '<p>Roter Baron:</p><p>Er hatte den Auftrag, seine Geliebte wieder zurck zu holen, als sie sich jedoch weigerte, hatte er einen Wutausbruch und brachte sie um. Seitdem trgt er Ketten, um Busse zu tun. Er bereut diese Tat zutieftst und mchte mit uns anschauen, wie man seine Gefhle im Griff hat.</p>'),
	('8189c8195acf', '<h3>Gefhrliche Stellen werden abgesperrt</h3><p><strong>Apotheke vor ort</strong></p>'),
	('8f568b5563a6', '<p>asdf</p>'),
	('48c38e095aad', NULL),
	('7cb2752737e2', '<p>alle tragen einen Schoner whrend den <em>Tanzbewegungen</em> und eine Schutzbrille</p>'),
