	('7a2282e04097', '<p>Unsere Flugtickets sind davongeflogen (Wind) wir mssen sie wieder einsammeln</p>'),
	('ac6b2f123ad3', '<p>Wir fliegen Ab. Die Flugbegleiter erklren uns wie wir in Notfallsituationen handeln mssen.</p>'),
	('ae634c4157a0', '<p>Apotheke in Aufenthaltszelt oder Matzelt (Nach SIKO)</p>'),
	('94bce49e1f03', '<p>Wir strzen ab. Der Pilot verlsst das Flugzeug frher, weil die Steuerung nicht mehr funktioniert und er der Meinung ist, dass wir in die Insel strzen wrden und er nicht sterben will. oder so hnlch de Pilot isch denn eifach verscholle</p>'),
	('3de702618ab9', '<p>Wir mssen die Insel erkunden</p>'),
	('17ec8168365a', '<p>Die eingeborenen greifen uns an und klauen uns unser essen.</p>'),
	('b3f5cbd532da', '<p>Apotheke mitnehmen, Gelnde vorher absuchen wegen Gefahren</p>'),
	('d9b4103a0ab1', '<p>Pfadigesetzt und Pfadiversprechen durch verschiedene Methoden lernen</p>'),
	('84b40e43160a', '<p>Apotheke im Aufenthalts / Matzelt (Nach SIKO)</p>'),
	('7d7fc79c95fd', '<p>wir mssen uns unser Essen zurckholen (evtl. Lasergame oder suscht was Geils)</p>'),
	('22d8c12d7df3', '<p>Gelende vorher Rekken (wespenneste etc)</p><p>Apotheke und handy dabei</p>'),
	('307055b3b9ca', '<p>Was knnte man machen um Rettung zu holen? Blubb meint wir sollten warten bis wir gerettet werden und uns ein wenig die Zeit vertreiben</p>'),
	('fb7c4182a43f', '<p>Wir lernen das Pfadigeetz und wie wir damit leben.</p>'),
	('21bca97eadd7', '<p>Apotheke und Handy vor Ort</p>'),
	('47b94d9ba46b', '<p>Plottwist der Pilot hat sich zum Anfhrer der eingeborenen hochgekmpft. und wir mssen ein Notsignal senden</p>'),
	('49d09f48b287', '<p>Apotheke mitnehmen, Gelnde vorher absuchen wegen Gefahren. Drei mal Pfeifen = besammeln beim neutralen Posten.</p>'),
	('d5114af3e81e', '<p>Handy bei leiter</p><p>Aputheke ist auf lagergelende vorhanden</p>'),
