INSERT INTO public.content_node_storyboard_section (id, column1, column2, column3, createtime, updatetime, "position", storyboardid) VALUES
	('d3d4ba4ca59b', 'culpa', 'natus', 'consequatur', '2022-01-23 16:19:10', '2022-01-23 16:19:10', 0, 'fdd159859a9f'),
	('3300d3c6526e', '<p>00:00</p>', '<p>Einreihen der Velos &amp; Luftkontrolle</p>', '<p>Castor</p>', '2022-02-04 21:10:32', '2022-02-04 21:10:46', 0, 'a6912f41f6c0'),
	('c2e811a887a3', '<p>''00 - ''15</p>', '<p>Als bergang zum TABS erklrt Farfalla was das Pafdivereprechen ist und wie es in Zusammenhang mit den Pfadigesetzen steht. Dann werden die TN darauf hingewiesen, dass sie im Lager die Mglichkeit haben werden das Versprechen abzulegen (jngere TN Vorversprechen) und sie sich Gedanken machen sollen, ob sie dies tun wollen oder nicht. Bei Fragen sollen sie sich bei Farfalla melden.</p>', '<p>Farfalla</p>', '2022-02-04 21:23:04', '2022-02-04 21:23:23', 0, '764477318be2'),
	('23a5eb29077d', '<p>''00</p>', '<p>bermittlung: Skippy, Castor</p><p>Kochen: Daniel Dsentrieb,</p><p>Ttschmeischter: Salamander</p><p>Sport: Adler &amp; Taifun &amp; Pandora</p><p>Pionier: Biber</p><p>Den TN werden zu Beginn die einzelnen Spez-Exer vorgestellt und sie knnen sich dann entscheiden, welchen sie machen mchten. Wenn sich fr ein Spez-Exer nur ein TN begeistert, wird dieser leider nicht durchgefhrt. Die Leiter die keinen fixen Spez-Exer haben, helfen den anderen wo ntig.</p>', NULL, '2022-02-04 21:25:38', '2022-02-04 21:25:52', 0, 'ea49fbe4a79b'),
	('41f57f88c17e', NULL, '<p>Hallo Velo Gigs</p>', NULL, '2022-02-04 21:28:07', '2022-02-04 21:28:12', 1, 'fd621d723248'),
	('227eb5f12656', '<p>00:10</p>', '<p>Begrssung &amp; Einsammeln von NFBs</p><p>Einleitung RF</p>', '<p>Farfalla</p>', '2022-02-04 21:11:06', '2022-02-04 21:11:41', 1, 'a6912f41f6c0'),
	('ef2bd62c8161', '<p>00:20</p>', '<p>Einteilung in schnelle und langsame Gruppe</p>', '<p>selbstndig</p>', '2022-02-04 21:11:08', '2022-02-04 21:11:48', 2, 'a6912f41f6c0'),
	('e7f982875d56', '<p>00:30</p>', '<p>Abfahrt</p><p>Trinkpausen sind in der MZB vermerkt</p>', '<p>Castor &amp; Taifun</p>', '2022-02-04 21:11:10', '2022-02-04 21:11:55', 3, 'a6912f41f6c0'),
	('2f644303a63f', NULL, '<p>test</p>', NULL, '2022-02-04 21:33:55', '2022-02-04 21:33:58', 0, '05b712aff209'),
	('0e20e1b1dff6', NULL, '<p>Die TN erledigen in ihren 4 mtligruppen die mtli:</p><p>- Abwaschen</p><p>- Holzen</p><p>- Joker (+ immer einmal pro Tag Lagertagebuch)</p><p>- Wasser auffllen</p><p>Ein Leiter bleibt bei den TN whrenddem die anderen hcken (nicht der Ta-Che) und "berwacht" die mtli: gibt Material frs Holzen heraus (je nach Alter TN und Fhigkeit), schaut dass das Abwaschen speditiv luft (Abwaschwasser gekocht etc.)</p><p>Sind die TN fertig mit ihren mtlis (von Leiter abgenommen und besttigt) haben sie Siesta --&gt; Freizeit: Sie knnen die Voil Freizeitangebote nutzen, die Leiter knnen nach ihrem Hck Spiele anbieten (wenn Zeit &amp; Lust) z.B. Volleyball. In dieser Zeit brieft der Ta-Che den Leiter, der nicht am Hck dabei war.</p>', NULL, '2022-02-04 21:13:04', '2022-02-04 21:13:07', 0, 'f81e2d53f972'),
	('856d17635097', '<p>5''</p>', '<p>Chanel 3 ist Russendisko</p><p>Chanel 1 ist nur Harry Potter Musik</p>', NULL, '2022-02-04 21:34:55', '2022-02-04 21:35:09', 1, 'd2187a3531af'),
	('f55456862941', NULL, '<p>Alle Gruppen waren bei allen Posten. Nun mssen sie die Tickets zusammensetzten</p>', NULL, '2022-02-04 22:34:32', '2022-02-04 22:34:56', 3, '9a4845d2e259'),
	('90d1b5a70397', '<p>''00 - ''120</p>', '<p>Aufteilung in Gruppen:</p><p>Gruppe 1 (5TN + 1 Leiter): Zelte aufstellen</p><p>Gruppe 2 (3TN + 1 Leiter): Latrine buddeln</p><p>Gruppe 3 (7TN + 1 Leiter): Aufenthaltszelt (Blachen knpfen und hochziehen)</p><p>Gruppe 4 (5TN + 1 Leiter): Kchenzelt, Kochstelle, Sickergrube</p><p>(ab und zu Trinkpausen machen)</p>', NULL, '2022-02-04 21:13:30', '2022-02-04 21:13:59', 0, '8245d44306f4'),
	('f6bf4c1984a0', '<p>''120 - ''140</p>', '<p>Z''Vieri</p>', NULL, '2022-02-04 21:13:32', '2022-02-04 21:14:02', 1, '8245d44306f4'),
	('3e6e22d61509', '<p>''140-''200</p>', '<p>weiter aufbauen (je nach Gruppenstimmung Gruppen wechseln)</p>', NULL, '2022-02-04 21:13:34', '2022-02-04 21:14:05', 2, '8245d44306f4'),
	('17502f244cdd', '<p>''200 - ''210</p>', '<p>gemeinsame Trinkpause und kurzes Spiel (Ritter auf Ritter ab)</p>', NULL, '2022-02-04 21:13:36', '2022-02-04 21:14:07', 3, '8245d44306f4'),
	('abc8ec81a53e', '<p>''200 - ''240</p>', '<p>Zelte wahrscheinlich fertig, dann:</p><p>J&amp;S Material holen (mit Veloanhnger)</p><p>Wasserschlauch von Waldran bis Lagerplatz anschliessen</p>', NULL, '2022-02-04 21:13:38', '2022-02-04 21:14:10', 4, '8245d44306f4'),
	('3b9221aa6e71', NULL, '<p>Zelte mssen trotzdem aufgebaut werden.</p><p>Zvieri bei Unterstand</p>', NULL, '2022-02-04 21:15:41', '2022-02-04 21:16:06', 0, '9e69a2d0f217'),
	('a6c259c27015', '<p>00:00</p>', '<p>Besammlung auf dem Lagerplatz. Wir spielen verschiedene Kurzspiele.</p><p>Zum Aufwrmen spielen wir ein kurzes Zitigls</p>', '<p>Pandora</p>', '2022-02-04 21:17:06', '2022-02-04 21:18:11', 0, '068370456651'),
	('34e8a4dd71e2', '<p>00:10</p>', '<p>Wir spielen ein British Bulldog.</p>', '<p>Pandora</p>', '2022-02-04 21:17:08', '2022-02-04 21:18:11', 1, '068370456651'),
	('a27f9e95f219', '<p>00:20</p>', '<p>Als nchstes spielen wir ein Stock im Kreis.</p>', '<p>Pandora</p>', '2022-02-04 21:17:10', '2022-02-04 21:18:12', 2, '068370456651'),
	('0c993d57a5df', '<p>00:30</p>', '<p>Jeder nimmt sich ein TN von der anderen Abteilung. Danach spielen wir ein Blinzlerspiel.</p>', '<p>Pandora</p>', '2022-02-04 21:17:12', '2022-02-04 21:18:12', 3, '068370456651'),
	('cf84fe747342', '<p>00:40</p>', '<p>Als nchstes Spielen wir ein Seilziehen in den mtli Gruppen.</p><p>Regeln vorher erklren: Niemand darf abrupt loslassen, gengend Abstand zu Bumen, wenn man merkt, dass man nicht mehr kann sagt man es und lsst nicht einfach los, Seil nicht um Handgelenk wickeln, nur halten ...</p>', '<p>Pandora</p>', '2022-02-04 21:17:14', '2022-02-04 21:18:13', 4, '068370456651'),
	('455589c526fb', '<p>00:55</p>', '<p>Zum Schluss machen wir ein Gordischer Knoten.</p>', '<p>Pandora</p>', '2022-02-04 21:17:40', '2022-02-04 21:18:14', 5, '068370456651'),
	('9c9ee531c062', '<p>00:00</p>', '<p>Erklrung des Ablaufs (verschiedene Phasen)</p><p>Erklrung der Special-Hogwarts-Features</p><p>Vorlesen der einzelnen Charakteren.</p><p>ausgedruckte Liste mit Charakteren aufhngen!</p>', '<p>Castor</p>', '2022-02-04 21:19:12', '2022-02-04 21:19:37', 0, '86f38eb0029e'),
	('4e1599d60183', '<p>''10</p>', '<p>Der Postenlauf beginnt, es gibt vier Posten  zwei Pfadigesetze, jeder Posten ist von mind. einem Leiter besetzt.</p><p>Die TN haben 10'' Zeit pro Posten und dann 5'' zum Wechseln.</p><p>Der gesamte Postenlauf dauert also 60 Minuten. es pfeift wenn gewechselt wird.</p><p>Die letzte Gruppe bei einem Posten hilft dann dem Leiter mit allem Material zurck zum Aufenthaltszelt- / platz zu kommen.</p><p>Beim Posten bespricht die Gruppe zuerst kurz was diese Pfadigesetze genau bedeuten und berlegt sich dann Reglen dazu, die im Lager ntzlich sein knnten. Der Postenbetreuer kann Inputs geben, falls die TN keine Idee mehr haben und schreibt die Regeln der TN auf. Am Ende des Postenlaufs streicht er dann alle doppelten Regeln, sodass nur noch die brigbleiben, die dann auf den Lagerpakt kommen.</p>', NULL, '2022-02-04 21:20:39', '2022-02-04 21:21:14', 1, '0810d1a172db'),
	('7b2e68cb2cd8', '<p>''00</p>', '<p>Erklrung RF und Postenlauf, die TN absolvieren den Postenlauf in ihren Huser-Gruppen (So lernen sie sich gleich besser kennen)</p>', '<p>Farfalla</p>', '2022-02-04 21:20:37', '2022-02-04 21:21:26', 0, '0810d1a172db'),
	('b27f81a08918', '<p>''70-''90</p>', '<p>Die Regeln werden zusammengetragen, ergnzt was sonst noch auf den Lagerpakt gehrt (TN wird erklrt, dass diese Regeln sicherheitsrelevant sind und daher nicht zwingend aus dem Pfadigesetz abgeleitet werden knnen) und dann mit allen TN durchgegeangen. Am Schluss unterschreiben alle TN den Lagerpakt.</p>', '<p>Farfalla</p>', '2022-02-04 21:20:42', '2022-02-04 21:21:33', 3, '0810d1a172db'),
	('0722fe21d3a7', '<p>''10 - ''70</p>', '<p>Posten 1: Offen und ehrlich sein und Freude suchen und weitergeben</p><p>(mgliche Regeln: Sagen wenn etwas kaputt geht, zu seinen Missgeschicken stehen etc.)</p><p>Posten 2: andere verstehen und achten und miteinander teilen</p><p>(Mgliche Regeln: kein Mobbing, einander zuhren, wenn Leiter sprechen ist es still...)</p><p>Posten 3: unsere Hilfe anbieten und uns entscheiden und Verantwortung tragen</p><p>(Mgliche Regeln: den Jngeren helfen, sein mtli sauber und korrekt erledigen etc,)</p><p>Psoten 4: Sorge tragen zur Natur und allem Leben und Schwierigkeiten mit Zuversicht begegnen</p><p>(Mgliche Regeln: Abfall in Abfallsack, wenn man ein Problem hat um Hilfe bitten, aber auch Verstand einsetzen ... )</p>', '<p>Postenbetreuer</p>', '2022-02-04 21:20:41', '2022-02-04 21:21:30', 2, '0810d1a172db'),
	('e76218c44124', '<p>''15 - ''30</p>', '<p>Wir singen im Kreis ein Bajuschki-Baju und der Ta-Che schliesst den Tag ab (kann selbst entscheiden wie, sicher den TN sagen ab wann Nachtruhe, wie viel Zeit sie zum Zhneputzen etc. haben)</p>', NULL, '2022-02-04 21:23:05', '2022-02-04 21:23:19', 1, '764477318be2'),
	('30940a279fee', NULL, NULL, NULL, '2022-02-04 21:28:05', '2022-02-04 21:28:05', 0, 'fd621d723248'),
	('c941d9362c2a', NULL, '<p>sdfdsfds</p>', NULL, '2022-02-04 21:29:54', '2022-02-04 21:29:56', 0, '9b7eb54688e6'),
	('7aeaaa96ec13', '<p>01:50</p>', '<p>Alles Essen wurde leider geklaut, Spielende. Wir gehen zurck zum Lagerplatz</p>', NULL, '2022-02-04 22:46:48', '2022-02-04 22:47:32', 4, '94448eaafa0d'),
	('fc2ec3d0e9d6', NULL, '<p>Titel/Thema:</p><p>Blutiger Baron - Wut</p><p>Zielgruppe:</p><p>Pfadistufenkinder 11-14Jahre</p><p>LeiterIn:</p><p>Castor, Salamander</p><p>Zeit:</p><p>30 min. (07.07.201522:30 - 23:00)</p><p>Ort/ Gelnde:</p><p>Spielwiese</p><p>Ziele:</p><p>Die TN erweitern ihren Handlungsspielraum im Umgang mit Wut.</p>', NULL, '2022-02-04 21:31:30', '2022-02-04 21:31:48', 0, '41463d5e6898'),
	('64faff942a2f', '<p>5''</p>', '<p>Einstieg:</p><p>Blutiger Baron stsst zu uns und erklrt uns seine missliche Lage.</p><p>Er zeigt uns vllig demtig seine Ketten.</p><p>Ketten &amp; Kugeln (vom Leiterfest)</p>', '<p>Salamander (blutiger Baron)</p>', '2022-02-04 21:31:32', '2022-02-04 21:32:01', 1, '41463d5e6898'),
	('20f8f3882f11', '<p>20''</p>', '<p>Hauptteil:</p><p>Die TN hocken in den Huser (4 Gruppen) zusammen und machen ein Theterli zum Thema WUT. Davon machen sie eine schlechte und eine gute Variante.</p><p>Oberbegriffe  Ideen zu den Theterli</p><p>-Schule</p><p>-Pfadi</p><p>-Eltern</p><p>-ffentlichkeit</p><p> Schlange stehen</p><p>5'' Vorbereitungszeit</p><p>Danach Auffhrung der Theterli. Nach jedem Theater kurze Diskussion angeregt durch den Baron.</p><p>5'' Um uns im Ruhigbleiben zu ben schlgt der Baron einen magischen Augenkampf vor.</p><p>Immer 2 zusammen, man muss einander in die Augen schauen und dabei mglichst ruhig bleiben.</p>', NULL, '2022-02-04 21:31:33', '2022-02-04 21:32:08', 2, '41463d5e6898'),
	('1e2db9a1e967', '<p>5i</p>', '<p>Abschluss</p><p>Der blutige Baron ist sehr zufrieden mit unseren Tns. Da er der Hausgeist von Slytherin ist und wir wissen, dass das Haussymbol der Slytherins eine Schlange ist, machen wir zum Abschluss einen Der Schlange ihre Tanz.</p>', NULL, '2022-02-04 21:31:35', '2022-02-04 21:32:27', 3, '41463d5e6898'),
	('77f6eb3edeed', '<p>0''</p>', '<p>Kopfhrer holen und looos</p>', NULL, '2022-02-04 21:34:53', '2022-02-04 21:35:05', 0, 'd2187a3531af'),
	('65ea440f50c7', NULL, '<p>Wir besammeln uns beim Bahnhof Oerlikon und gehen nach der Besammlung zum MFO-Park.</p><p>Die Leiter haben leider die Flugtickets verloren. Die Einzelteile sind nun in ganz Oerlikon verteilt. Wir mssen sie nun wieder einsammeln.</p>', NULL, '2022-02-04 22:34:26', '2022-02-04 22:34:40', 0, '9a4845d2e259'),
	('ba90e536e088', NULL, '<p>Um die Gruppen einzuteilen machen wir ein Atmle: Es rennen alle durcheinander und eine Leitperson sagt eine Zahl. Nun mssen die TN''s sich in Gruppen dieser Anzahl stellen. Alle die nicht in einer Gruppe (einem Atom) sind scheiden aus und werden in Gruppen eingeteilt</p>', NULL, '2022-02-04 22:34:28', '2022-02-04 22:34:47', 1, '9a4845d2e259'),
	('d69b5b763725', NULL, '<p>Jede Gruppe bekommt eine Karte und es findet ein Stern-OL statt.</p><p>Bei jedem Posten finden sie einen Teil des Tickets</p><p>Jede Gruppe muss bei jedem Posten vorbei.</p>', NULL, '2022-02-04 22:34:30', '2022-02-04 22:34:51', 2, '9a4845d2e259'),
	('5814cc91534e', NULL, '<p>Wir treffen uns um 18:00 am Bahnhof Oerlikon.</p>', NULL, '2022-02-04 22:35:30', '2022-02-04 22:35:43', 0, 'e9d479b98d18'),
	('6dd320aca835', NULL, '<p>Wir nahmen den 10er in Zrich Bhf Oerlikon Ost richtung Flughafen um 18:31 ankunft 1844 in zrich Flughafen</p>', NULL, '2022-02-04 22:35:32', '2022-02-04 22:35:49', 1, 'e9d479b98d18'),
	('82d2a79399f2', NULL, '<p>18:49 BUS 524 8063 Richtung Oberembrach, Dorf bis nach Lufigen Augwil. Ankunft 18:58</p>', NULL, '2022-02-04 22:35:34', '2022-02-04 22:35:53', 2, 'e9d479b98d18'),
	('4c2906abc8f8', NULL, '<p>Wir laufen zum Lagerplatz</p>', NULL, '2022-02-04 22:35:36', '2022-02-04 22:35:57', 3, 'e9d479b98d18'),
	('4c9195299bfe', NULL, '<p>Wir machen vier Gruppen.</p><p>Gruppe1 Kche-Aufenthalt-Essenszelt</p><p>Gruppe2 Schlafzelter</p><p>Gruppe3 Kcheninneneinrichtung</p><p>Gruppe4 Latrine</p>', NULL, '2022-02-04 22:38:13', '2022-02-04 22:38:22', 0, '00c6fe37b137'),
	('9e9e6773aa33', NULL, '<p>Alle Gruppe berlegen wo sie Ihre Zelter / Bauten Aufstellen mchten und zeichnen ein Plan-Krokki auf ein Packpapier. Fr Ausbesserungen und Fragen steht Tassilo bereit.</p>', NULL, '2022-02-04 22:38:15', '2022-02-04 22:38:28', 1, '00c6fe37b137'),
	('017c12813f27', NULL, '<p>Gruppe2 beginnt mit dem Aufbau der Schlafzelter</p><p>Dazu zeigt der Gruppenleiter zuerst vor, wie man in einer 3er Gruppe einen Spatz aufstellt. Dann werden 3 er Gruppen gebildet und die TN wiederholen das gezeigte mit dem Aufbau von weiteren Spatzen. </p><p>Gruppe1, Gruppe3 und Gruppe4 Der Gruppenleiter zeigt vor, wie gewisse Ttigkeiten (Seil spannen, Blachen mit Seil spannen, Blachen knpfen) richtig gemacht werden. Dann wiederholen die TN das gezeigte an den weiteren Stellen, wo das gemacht werden muss.</p>', NULL, '2022-02-04 22:38:16', '2022-02-04 22:38:32', 2, '00c6fe37b137'),
	('2cf0a4effc12', NULL, '<p>Alle Zelter sind Aufgestellt und besprechen wo es Schwierigkeiten gegeben hat und wie man es besser lsen knnte.</p>', NULL, '2022-02-04 22:38:18', '2022-02-04 22:38:36', 3, '00c6fe37b137'),
	('4b11ebf61fdf', '<p>0:15</p>', '<p>Um zum Flugzeug zu kommen laufen wir mit einem Flughafenmensch  entlang der Flugpiste (mit Kerzen oder Leuchtstbli abgesteckt). Wir setzen uns alle im Flugzeug (Pflanzentunnel Familie Amacher, alternative: jedes Kind liegt schon an seinen Schlafplatz symbolisch fr Sitzplatz) in Reihen hin (wie im Flugi). Die Flugbegleiterin / Der Flugbegleiter erklrt uns die Sicherheitsregeln und der Pilot wnscht uns einen guten Flug.</p>', '<p>Snoopy, Idefix</p>', '2022-02-04 22:38:53', '2022-02-04 22:39:37', 1, '78e81d1fbf0d'),
	('fd2c5e228adb', '<p>0:30</p>', '<p>Da wir uns auf einem Langstreckenflug befinden, knnen die mden Passagiere sich auf die Schlafpltze begeben (Zhneputzen und in die Zelter gehen). Der Flug beginnt.</p>', '<p>Snoopy, Idefix</p>', '2022-02-04 22:38:55', '2022-02-04 22:39:38', 2, '78e81d1fbf0d'),
	('136dd095cc12', '<p>00:00</p>', '<p>Die TN werden von lautem Sirenengeheul geweckt. Ein Triebwerk des Flugzeugs, in dem wir fliegen, ist ausgefalllen. Alle mssen sofort auf ihre Sitzpltze und die Gurte anschnallen.</p>', NULL, '2022-02-04 22:41:32', '2022-02-04 22:41:58', 0, 'f5b193a90c4f'),
	('2a3c0020d188', '<p>00:15</p>', '<p>Alle Kinder sind auf ihren Sitzpltzen angeschnallt, dann beginnt eines der Triebwerke zu brennen und die Sauerstoffmasken kommen aus der Decke, sie mssen diese alle Anziehen.</p>', NULL, '2022-02-04 22:41:34', '2022-02-04 22:42:01', 1, 'f5b193a90c4f'),
	('5adace9e0a6a', '<p>0:00</p>', '<p>Um unsere Reise sicher zu starten mssen wir alle durch die Sicherheitskontrolle: Holz Bogen mit Lichter etc wie am Flughafen, Sicherheitskontrolle bei Security (abtasten). Bei einigen TN''s piepst es und wir schmuggeln ihnen unerlaubte Gegenstnde wie Wasserpistolen, Trinkflaschen etc. unter. Die TN''s mit unerlaubten Gegenstnde mssen als Strafe 5 mal um die Zelter rennen und 10 Liegesttzen machen. Sobald alle durch die Kontrolle sind knnen wir ins Flugzeug.</p>', '<p>Snoopy, Idefix</p>', '2022-02-04 22:38:51', '2022-02-04 22:39:34', 0, '78e81d1fbf0d'),
	('5a2cf8cb9fcd', '<p>00.20</p>', '<p>Triffdenddel: Alle stehen in einem Kreis und man wirft eine mit Wassergefllten Pet Flasche einer Person zu und die Person mus die Flasche einhndig fangen wenn er sie nicht fngt mus er um den kreis rennen und man kann ihn abwerfen er muss solang er getroffen wird rundenen rennen bis er es ihn seine lcke schafft.</p>', NULL, '2022-02-04 23:02:57', '2022-02-04 23:03:20', 1, 'bbc4c3603119'),
	('7205b3e85428', '<p>00:10</p>', '<p>Spielerklrung (Ikarus):</p><p>Auf einem Spielfeld ist das Lager eingezeichnet, und 3 verschiedene Wege, die zu 3 verschiedenen Lagern fhren. Auf jedem Weg ist ein Eingeborener, der das Essen aus dem Lager klauen will. Bei jedem Lager sind 5 Essen, die geklaut werden knnen, wenn eine Gruppe kein Essen mehr hat, hat sie verloren. Jedes mal, wenn ein Eingeborener es bis ins Lager geschafft hat, ist ein Essen weg. Jede Viertelstunde kann ein TN pro Gruppe zum neutralen Posten kommen, und mit Bndeli Wrfelwrfe kaufen. Mit jedem Wrfelwurf kann man einen Eingeborenen bewegen, es ist aber egal, welchen. Wenn man aber den Eingeborenen auf einem anderen Weg nher an deren Lager fhrt, dann werden die Eingeborenen natrlich diesen weiter bewegen, da dieser eher Essen klauen wird.</p><p>Die Eingeborenen sind natrlich auch eine Gruppe, die versucht, mglichst viel Essen zu klauen, und auch mit Bndeli Wrfelwrfe kauft, die sie jede Viertelstunde eintauscht. Jede Gruppe hat an einem Gruppenplatz einen Knuel mit der eigenen Bndelifarbe.</p><p>Sobald der Eingeborene das Essen gelaut hat, ist er wieder auf dem Startfeld</p><p>Neutraler Posten: Ikarus</p><p>Eingeborene: Tassilo, Blinky, Jiminy, Swuppi, Zera, Blubb</p>', NULL, '2022-02-04 22:46:38', '2022-02-04 22:47:21', 1, '94448eaafa0d'),
	('cabbf57a8dd1', '<p>02:00</p>', '<p>Ende</p>', NULL, '2022-02-04 22:47:08', '2022-02-04 22:47:35', 5, '94448eaafa0d'),
	('91a943219db6', NULL, '<p>Beim Aufenthaltszelt wird den Kindern erklrt was eine A Blache und was eine B Blache ist. Nun mssen die Kinder die A Blachen von den B Blachen trennen und ein Leiter demonstriert ihnen wie man eine Reepschnur korrekt einfdelt. Die Kinder machen das nach und fassen die Blachen in 10erhufen zusammen.  Am schluss machen sie zuerst gemeinsam mit einem Leiter und dann alleine Blachenbnde.</p>', NULL, '2022-02-04 23:04:11', '2022-02-04 23:04:23', 2, 'ac207e1f00cb'),
	('8c1b7cd7f93d', '<p>0.20</p>', '<p>Es werden 3er Gruppen gebildet, jede Gruppe bekommt ein Couvert. Im Couvert finden sie, die Stze des Pfadigesetze sin Stcke geschnitten. Ziel ist es zu dritt das Pfadigesetz wieder zusammen zu setzen z.B. auf einer Blache vor dem Aufenthaltszelt Stze zusammen kleben</p><p>Sobald das Pfadigesetz zusammen gesetzt ist, sollen sich die Gruppe den wichtigsten Satz aus dem Gesetz heraussuchen.</p>', NULL, '2022-02-04 22:50:07', '2022-02-04 22:50:40', 1, '847374e5e4bf'),
	('33f8809caed0', '<p>0.50</p>', '<p>Anschliessend treffen sich alle wieder im Aufenthaltszelt und jede Gruppe stellt den fr sie wichtigsten Satz aus dem Pfadigesetz vor und es wird diskutiert warum dies sein kann oder nicht.</p>', NULL, '2022-02-04 22:50:08', '2022-02-04 22:50:44', 2, '847374e5e4bf'),
	('cceb8b974c0c', '<p>00.20</p>', '<p>Auf ihrem Vorrat (ein loch) hat es aufgeblasene Ballone und essensreste (schweine magen, also weisse ballone), die wir zuerst verplatzen mssen. ein teil der Kinder lenkt die Aboriginis ab (ohne berhren) und die andern mssen die Ballone verplatzen gehen und haben drei leere Ballone dabei. Doch bei jedem platzen, rennt ein aborgini los und versucht den TN zu catchen, wenn ers geschafft hat muss der Tn ihm ein Ballon abgeben. Die TNs mssen hinter eine sicherheits linie rennen und dort sind sie dann safe. Fr neue Ballone mssen die Tns fragen beantworten oder Aufgaben machen. Ziel ist, dass alle ballone im Vorrat geplatzt sind und wir unser essen zurck holen knnen.</p>', NULL, '2022-02-04 22:52:15', '2022-02-04 22:52:41', 2, '3127de277825'),
	('dc79c54c280d', '<p>0010</p>', '<p>Wir machen ein Triff den Ddel. Alle stehen im Kreis und ein Ball wird gegnseitig zugespielt. Der Ball darf nur mit einer Hand geworfen und gefangen werden. Wenn man den Ball nicht fngt muss man eine runde um den kreis rennen. wenn man wrend dieser runde vom Ball getroffen wird, muss man nochmals rennen. Wenn man einen schlechten passt schiesst muss man auch rennen. Die rennende person kann mehrmals wieder abgeschossen werden</p>', NULL, '2022-02-04 22:54:31', '2022-02-04 22:54:50', 1, '8af65594aee7'),
	('e3602eadc6ef', NULL, '<p>Diverse Bastelspass mit Blubb</p><p>Wir knpfen Bndeli auf spezielle Art (Beispielbndeli von Blubb)</p><p>Wir lernen wie man einen Kranich faltet. (Bei 1000 Kranich hat man einen Wunsch frei. Wir knnten uns wnschen, dass wir gerettet werden)</p><p>How to make a Hexaflexagon.</p>', NULL, '2022-02-04 22:55:06', '2022-02-04 22:55:24', 1, '7fb4b671a287'),
	('1e7ebcd243bd', NULL, '<p>Nach einer Weile spielen wir ein Paar spiele um uns wieder etwas zu bewegen.</p><p>Amerikanische Buldoggen</p><p>Schreimauer. Es giebt einen Sender und einen Empfnger. Der Sender muss dem Empfnger eine Nachricht schreien. Die restlichen personen mssen das verhindern indem sie eine Lrmwand machen zwischen dem Sender und dem Empfnger und in dei Reichtung des Senders schreien.</p>', NULL, '2022-02-04 22:55:13', '2022-02-04 22:55:38', 4, '7fb4b671a287'),
	('72b1adb23ca9', '<p>00:10</p>', '<p>SPIELERKLRUNG (Blinky):</p><p>Es muss ein Notsignal gesendet werden. Beide Parteien haben dafr je ein mit Absperrband abgesperrter Bereich im Wald (ca5x5m) mit je 10 Leuchtstbchen. Beide Teams mssen versuchen ein Leuchtstbchen vom Gegnerischen Bereich Klauen und zu ihrer eigenen Base bringen. Wer am meisten Leuchtstbchen in seiner Base hat gewonnen und darf das Notsignal mit den Stbchen schreiben. Umeinander davon abzuhalten ihre Leuchtstbchen zu klauen kann 3 mal auf den rcken des Angreifers geklopft werden (wenn dieser ein Leuchstbchen hat muss er dieses zurck gebeb). Der beklopfte muss dann auf der stelle 5 Liegesttzen machen und zurck zur seiner Base gehen.</p><p>Die Eingeborenen klauen whrenddessen immer wieder Leuchtstbchen weil sie diese fr Magische Stckchen halten.</p><p>Die Leuchtstchen knnen dann wieder an einem neutralen Posten mit PfadiTech Wissen oder wenn 2 gegnerische TNs ein Leuchtstbchen wollen mit einer Challenge zurckerobert werden.</p><p>SPIELABRUCH/ENDE:</p><p>3x pfeifen</p>', NULL, '2022-02-04 22:59:40', '2022-02-04 23:00:45', 2, 'f28ae87dfdcd'),
	('e013f6eefaf2', '<p>01:40</p>', '<p>Spielende</p><p>Alle TNs besammeln sich. Sie schauen sich zusammen mit den Eingeborenen die Notsignale an. Die Eingeborenen sind beidruckt und helfen beim aufrumen drfen dafr aber die Leuchtstbe behalten. Der Pilot ist abgehauen -&gt; wieder als Leiter anwesend</p>', NULL, '2022-02-04 22:59:48', '2022-02-04 23:00:58', 5, 'f28ae87dfdcd'),
	('ed357d92cc86', NULL, '<p>laufen die Kinder (vereinzelt) zurck zum Lagerplatz wenn sie alles berdenkt haben.</p><p> Danach gibt es das Lagerfeuer-feeling in der Kche mit Schoggi-Bananen und Marshmallows.</p>', NULL, '2022-02-04 23:02:15', '2022-02-04 23:02:27', 2, '8e2119b66e8f'),
	('869aa7803e5e', '<p>00:20</p>', '<p>Ein Triebwerk explodiert und kurz darauf schlagen wir auf, die Leiter stossen alle Kinder durcheinander und werfen die "Sthle" um, um den Absturz zu simulieren.</p>', NULL, '2022-02-04 22:41:35', '2022-02-04 22:42:04', 2, 'f5b193a90c4f'),
	('c2539b5d9c2e', '<p>00:25</p>', '<p>Wir regen uns langsam am Boden, um uns herum das zerstrte und brennende Flugzeug. Einem Leiter wurde der Arm aufgeschlitzt (Blinky) und er blutet stark, um erste Hilfe zu leisten suchen wir die Apotheke im Flugzeug. Wir versuchen, Rettungskrfte zu kontaktieren, haben aber kein Netz. Nachdem wir festgestellt haben, dass alle da sind und der verletzte Leiter versorgt ist, teilen wir Wachen  ein (nur die Leiter, die wachen nicht wirklich sondern gehen dann schlafen) und schicken die TN wieder ins Bett.</p>', NULL, '2022-02-04 22:41:37', '2022-02-04 22:42:08', 3, 'f5b193a90c4f'),
	('da7fe032485a', '<p>00:00</p>', '<p>Die TN sitzen mit Ikarus gemtlich im Aufenthaltszelt, als pltzlich die Kche schreit: Alarm Alarm. Wir rennen sofort zur Kche und sehen noch einen Eingeborenen (Tassilo) mit einem Leib Brot davon rennen. Wir nehmen natrlich sofort die Verfolgung auf und rennen ihm hinterher. Er rennt zu einer Gruppe Eingeborenen mit einem Huptling (Blubb) und diese bleiben stehen. Sie sind so viele, dass wir nicht direkt angreifen. Wir schreien ihn an, dass er sofort das Brot zurck geben muss. Der Huptling findet, das ist sein Land und wir sollten sofort verschwinden. Wir sagen wir hatten einen Flugzeugabsturz und warten auf Hilfe und knnen nicht weg, da wir nicht wissen, wohin. Der Huptling hlt uns aber fr bse Dmonen, die er vernichten muss, wir werden nie ruhig schlafen und essen auf seinem Land, bis wir weg sind. Dann verschwinden die Eingeborenen im Wald, und das Game beginnt.</p>', NULL, '2022-02-04 22:46:36', '2022-02-04 22:47:17', 0, '94448eaafa0d'),
	('da1970ada3d7', '<p>00:20</p>', '<p>Jede Gruppe sucht sich einen Gruppenplatz und bindet sich das Bndli an.</p>', NULL, '2022-02-04 22:46:40', '2022-02-04 22:47:26', 2, '94448eaafa0d'),
	('101e07c2a1f9', '<p>00.30</p>', '<p>Gordischer Knoten :Einer geht 1 minute weg und die restlichen Personen mssen sich so gut wies geht verknoten das ziel ist das die eine person den knoten wieder aufmacht. SS</p>', NULL, '2022-02-04 23:02:59', '2022-02-04 23:03:23', 2, 'bbc4c3603119'),
	('707018292bda', NULL, '<p>Bei den Schlafzelten zeigen die Leiter den Teilnehmern wie sie ein Spatz korrekt abbauen und reinigen. Die Kinder machen das nach.</p>', NULL, '2022-02-04 23:04:09', '2022-02-04 23:04:20', 1, 'ac207e1f00cb'),
	('b4faba7e807b', '<p>1.20</p>', '<p>Nach der Diskussion bleibt Zeit zu 2. oder zu 3. das Pfadiversprechen zu reptieren und zu lernen wer will kann Stift und Papiere haben oder es den Leitern vorsagen</p>', NULL, '2022-02-04 22:50:11', '2022-02-04 22:50:47', 3, '847374e5e4bf'),
	('ab86b3328ada', '<p>00.00</p>', '<p>Wir finden eine essens-, federspur und folgen dieser, weil das ja sciher die aboriginis waren</p>', NULL, '2022-02-04 22:52:11', '2022-02-04 22:52:35', 0, '3127de277825'),
	('227bc3f5e5d6', '<p>1.10</p>', '<p>Die Aboriginis sind geschlagen, wir haben unser essen wieder und laufen glcklich zum lagerplatz zurck.</p>', NULL, '2022-02-04 22:52:16', '2022-02-04 22:52:46', 3, '3127de277825'),
	('c0ddcf9c9198', '<p>0030</p>', '<p>Ende und wir gehen Zmorgen essen</p>', NULL, '2022-02-04 22:54:33', '2022-02-04 22:54:53', 2, '8af65594aee7'),
	('ce22edd22759', NULL, '<p>Was giebt es besseres als zu Snacken beim Warten. Wir erklren den Kindern wie man Brennesselchips macht.</p><p>1. Die Brennnesseln am besten mit Handschuhen schneiden und die Bltter abpflcken</p><p>2. Bltter waschen und in Salatschleuder trocknen. Sobald die Brennnesseln gewaschen sind, brennen sie nicht mehr!</p><p>3. Kokosfett oder Rapsl in der Pfanne heiss werden lassen, die Brennnesselbltter beifgen und mit der Kelle vorsichtig wenden</p><p>5. Wenn die Bltter knusprig sind, auf Kchenpapier abtropfen lassen</p><p>6. Mit Salz, Curry oder anderen Gewrzen bestreuen und sofort geniessen</p>', NULL, '2022-02-04 22:55:08', '2022-02-04 22:55:27', 2, '7fb4b671a287'),
	('118a941d5b7f', '<p>00.00</p>', '<p>Jemand liest das Verspechen lauf vor.</p><p>Wir machen vier (Je nach anmeldungen fnf) Gruppen.</p><p>in Posten besprechen sie mit einem Leiter ein Stck des Versprechens.</p><p>bedeutung, umsetzung etc.</p><p>Posten 1: Ich verspreche/ mein Mglichstes zu tun</p><p>Posten 2: mich immer von neuem mit dem Pfadigesetz auseinanderzusetzen</p><p>Posten3:mich in jeder Gemeinschaft einzusetzen, in der ich lebe</p><p>Posten4:Nach Sinn und Ziel meines Lebens zu suchen</p><p>Posten5:zusammen mit euch allen</p>', NULL, '2022-02-04 22:57:28', '2022-02-04 22:58:18', 0, '1a978f02a760'),
	('a9c164613e61', '<p>14:20</p>', '<p>Bagheera und Maki werden ber das bevorstehende Game aufgeklrt. Sie mssen je eine kleine rolle bernehmen. Beide mchten von dieser Insel weg jedoch die andere Person bzw Gruppe nicht dabei haben.</p>', NULL, '2022-02-04 22:59:37', '2022-02-04 23:00:39', 0, 'f28ae87dfdcd'),
	('0d1107eb519c', '<p>00:20</p>', '<p>Spielstart</p><p>Tassilo(Pilot) und Blinky(Eingeborener) verkleiden sich fr spter.</p>', NULL, '2022-02-04 22:59:43', '2022-02-04 23:00:49', 3, 'f28ae87dfdcd'),
	('c8467492f673', '<p>01:50</p>', '<p>Zurcklaufen mit Tassilo. Eingeborene laufen zurck in den Wald.</p>', NULL, '2022-02-04 22:59:50', '2022-02-04 23:01:01', 6, 'f28ae87dfdcd'),
	('f7310f31c767', NULL, '<p>Wir Treffen uns vor der Kche und alle Kinder werfen ihren Anonymen Brief in denn Pfaditopf. Danach wird nachmals der ganze Ablauf erklrt. </p><p>1. Still zum Bi-Pi Feuer laufen.</p><p>2. Feuer anznden</p><p>3. Brief</p><p>4. Abteilungslied singen</p><p>5. Private Zettel vorlessen</p>', NULL, '2022-02-04 23:02:12', '2022-02-04 23:02:20', 0, '8e2119b66e8f'),
	('10cd9ac18ca3', '<p>0010</p>', '<p>Zum einwrmen machen wir ein Pferderennen. Dabei klatschen sich alle mit den Hnden auf die Oberschenkel um das Hufgetrappel zu simulieren. Der Spielleiter gibt dann kommandos welche dann von allen durchgefhrt werden mssen wenn jemand ein Kommando verpasst oder ein Kommado falsch macht muss 3 Liegesttze machen. z.B. bei der Linkskurve lehnen alle nach links</p>', NULL, '2022-02-04 22:43:23', '2022-02-04 22:43:43', 0, 'e3a4242a7d93'),
	('50f77ad2a232', '<p>0025</p>', '<p>Als Hauptteil gehen wir in der nheren umgebung Joggen. Die Leitperson gibt immer wieder Kommandos vor bei welchen alle die vorgegebene bung machen mssen. z.B. bei 1 mssen alle springen.</p>', NULL, '2022-02-04 22:43:25', '2022-02-04 22:43:45', 1, 'e3a4242a7d93'),
	('fd662ae8e53b', '<p>0030</p>', '<p>Zum Abschluss spielen wir noch ein Peng. Dabei wird zuerst ein Thema definiert z. B. Produkte aus der Migros. Das Ziel des Spiels ist es, dass man bis zum Schluss nicht ausgeschieden wird. Dann stellen sich immer zwei Personen Rcken an Rcken und gehen los. Dann sagt der Spielleiter einen Buchstaben und die Kinder mssen sich umdrehen und so schnell wie mglich ein Migros Produkt sagen, dass mit diesem Buchstaben anfngt. Wenn man verliert wird man ausgeschieden.</p>', NULL, '2022-02-04 22:43:27', '2022-02-04 22:43:48', 2, 'e3a4242a7d93'),
	('4593b11e31e9', NULL, '<p>Wir bessern aus was auszubessern ist</p>', NULL, '2022-02-04 22:44:05', '2022-02-04 22:44:08', 0, 'ad3c129b71fd'),
	('f15835e62afe', '<p>00.05</p>', '<p>Aufwecken mit Musik</p>', NULL, '2022-02-04 23:02:53', '2022-02-04 23:03:17', 0, 'bbc4c3603119'),
	('7874ae728819', '<p>0130</p>', '<p>Zum abschluss spielen wir ein Schoggispiel. Dabei muss sich eine Person winterhandschuhe und diverse utensilien anziehen und darf dann beginnen mit Messer und Gabel eine in in Zeitund eingepackte Schokoladentafel zu essen. Die anderen versuchen mit Wrfeln eine 6 zu wrfeln. wenn ihnen das gelingt muss die essende Person alle utensilien ablegen und die neue Person muss sie anlegen und darf versuchen die schokolade zu essen. vor jedem wrfeln muss man einen Hampelmann machen.</p>', NULL, '2022-02-04 22:44:26', '2022-02-04 22:44:54', 2, 'e7d30e274563'),
	('8dbe3d0b9c61', NULL, '<p>Wir laufen 1420 los</p>', NULL, '2022-02-04 23:04:47', '2022-02-04 23:04:52', 0, '8fc6eca9bc8a'),
	('b63b74dc8292', '<p>0115</p>', '<p>Wir machein einen OL bei dem Jede gruppe zuerst einen Teil der Karte bekommt. nun ist ein Punkt auf einem Sichtmpli eingezeichnet an dem der Posten sein muss. Sie mssen nun entweder abschtzen wo der neue Kartenteil sein knnte oder mit den anderen Gruppen zusammenarbeiten um dei Posten zu finden.</p>', NULL, '2022-02-04 22:44:22', '2022-02-04 22:44:47', 0, 'e7d30e274563'),
	('22c4651d8c57', '<p>0015</p>', '<p>Um unseren oreinteierungssinn zu schrfen wird in einem definierten Feld ein gegenstand geworfen den man mit glocken hrt. Nun knnen die Teilnehmer (sie haben sich die Augen verbunden) mithilfe ihres gehrssinnes versuchen diesen gegenstand zu finden. Dieses Spiel wird mehrmals wiederholt bis wir unsere Sinne geschrft haben.</p>', NULL, '2022-02-04 22:44:24', '2022-02-04 22:45:29', 1, 'e7d30e274563'),
	('186d9eaa93bb', '<p>00:30</p>', '<p>Alle Gruppen haben Bndli angebunden und den Gruppenplatz bestimmt, Spielstart</p>', NULL, '2022-02-04 22:46:42', '2022-02-04 22:47:29', 3, '94448eaafa0d'),
	('1c62367edd7f', '<p>0.00</p>', '<p>Wir schreiben gemeinsam das  Pfadiversprechen und das Pfadigesetz auf (TN''s sollen sagen was sie schon wissen, wir ergnzen): </p><p>Versprechen:</p><p>Ich verspreche, mein mglichstes zu tun, um </p><p>mich immer von neuem mit dem Pfadigesetz auseinanderzusetzen</p><p>nach Sinn und Ziel meines Lebens zu suchen</p><p>mich in jeder Gemeinschaft einzusetzen, in der ich lebe</p><p>(Im Vertrauen auf Gott und) Zusammen mit Euch allen versuche ich, nach diesem Versprechen zu leben. </p><p>Gesetz:</p><p>Wir Pfadi wollen...</p><p>...offen und ehrlich sein</p><p>...Freude suchen und weitergeben</p><p>...unsere Hilfe anbieten</p><p>...uns entscheiden und Verantwortung tragen</p><p>...andere verstehen und achten</p><p>...miteinander teilen</p><p>...Sorge tragen zur Natur und allem Leben</p><p>...Schwierigkeiten mit Zuversicht begegnen</p>', NULL, '2022-02-04 22:50:05', '2022-02-04 22:50:35', 0, '847374e5e4bf'),
	('9fb1cf8cd05d', '<p>1.50</p>', '<p>Wir treffen uns nochmals im Aufenthaltszelt um Fragen zu klren. Wir versuchen nochmals alle Teile des Pfadiversprechens und Pfadigesetzt zusammen zu bringen (mndlich)</p>', NULL, '2022-02-04 22:50:13', '2022-02-04 22:50:50', 4, '847374e5e4bf'),
	('5d8db3cd4d59', '<p>00.15</p>', '<p>Wir finden das Aboriginis versteck, jedoch bewachen sie ihren Vorrat und wir berlegen uns wie wir sie ablenken knnen. (Sackmesser, Taschenlampen, musik, einfach neue dinge, die sie nicht kennen)</p>', NULL, '2022-02-04 22:52:13', '2022-02-04 22:52:38', 1, '3127de277825'),
	('b516b77b8269', '<p>0000</p>', '<p>Aufwecken mit Musik</p>', NULL, '2022-02-04 22:54:29', '2022-02-04 22:54:48', 0, '8af65594aee7'),
	('5820c26d3384', NULL, '<p>Wir besammeln uns im Aufenthaltszelt und besprechen was wir machen knnten. Die Leiter disskutieren Laut ob wir eventuell ein Notsignalfeuer machen knnten. Andere meinen wir knnten mit steinen einen Hilferuf schreiben, damit man diesen aus der Luft sehen wrde. Blubb ist der Meinung, dass wir warten sollten bis hilfe kommt und uns etwas die Zeit vertreiben sollten. wir machen Posten an denen man verschiedene Sachen lernen kann.</p>', NULL, '2022-02-04 22:55:04', '2022-02-04 22:55:19', 0, '7fb4b671a287'),
	('f1df09d6a960', NULL, '<p>Fr diejenigen die doch noch ewas sinnvolles machen wollen zeigen wir ihnen wie man Zundhlzli wasserdicht macht. Dazu schmilzt man etwas wachs und legt sie im Wachs ein sodass eine Schicht Wachs um das Streichholz entsteht. Dasselbe macht man nun mit dem Anzndstreifen und Voila Wasserdicht.</p><p>Flaschenpost.</p><p>Die Kinder drfen frei eine Nachricht entwerfen die wir in eine Flaschenpost tun. Diese Flaschenpost werden wir dann in irgend einer bung in einem Halben Jahr wiederfinden.</p><p>Ausserdem kann man ein paar Zundhlzlirtsel machen: </p><p>Aus sechs Streichhlzern 4 gleich grosse Dreiecke machen</p><p>Aus 4 Streichhlzern 5 Rechtecke machen</p><p>Die mnze aus der Schaufel nehmen</p>', NULL, '2022-02-04 22:55:10', '2022-02-04 22:55:33', 3, '7fb4b671a287'),
	('088ff7862e85', '<p>1.00</p>', '<p>Wir lernen das Pfadiversprechen mit dem "Ich packe in meinen Rucksack"-Spiel </p><p>Es beginnt jeamd und sagt "Ich..." und dann der reihe nach immer wieder holen was die andern zuvor gesagt haben und das nchste Wort des Versprechens nennen.</p>', NULL, '2022-02-04 22:57:29', '2022-02-04 22:57:52', 1, '1a978f02a760'),
	('5a32884b6a15', '<p>00:00</p>', '<p>Bagheera und Maki streiten im Aufenthaltszelt. Blinky bildet 2 Gruppen -&gt; Der Grsse nach aufstellen und auf 2 nummerieren. </p><p>Blinky luft dann mit beiden Gruppen in den Wald</p>', NULL, '2022-02-04 22:59:38', '2022-02-04 23:00:42', 1, 'f28ae87dfdcd'),
	('ccbf68d8e638', '<p>00:30</p>', '<p>Pilot (Tassilo)und eingeborene(alle Leiter) klauen Stbchen min. 1 Eingeborener ist hierbei beim neutralen Posten (erste paar Minuten Blinky).</p>', NULL, '2022-02-04 22:59:45', '2022-02-04 23:00:54', 4, 'f28ae87dfdcd'),
	('6f1975b376c1', NULL, '<p>Zusammen Laufen wir zum Bi-Pi Feuer und geniessen unser Ritual.</p><p>1. Der Feuermeister macht Feuer</p><p>2. Zera liest den Letzten Brief von Bi-Pi vor</p><p>3. Wir Singen das Abteilungslied</p><p>4. Wir geben denn Kessel durch und jeder zieht einen Zettel der er vorliest</p>', NULL, '2022-02-04 23:02:13', '2022-02-04 23:02:24', 1, '8e2119b66e8f'),
	('bff19405d956', NULL, '<p>Nach dem Zvieri Sagen wir den Kindern, dass es heute Abend ein Bi-Pi Feuer geben wird. Wir erklren, was das Bi-Pi Feuer ist. Fr das Bi-Pi Feuer mssen natrlich vorbereitungen getroffen:</p><p>Zum einen muss jeder etwas gutes, etwas schlechtes (zur Pfadi) und einen Wunsch sowie ein Danke oder einen Glckwunsch aufschreiben (alles Anonym)</p><p>Ausserdem werden auch zwei freiwillige das Feuer nach Anleitung vorbereiten.</p><p>Das Bi-Pi Feuer ist eine Tradition die die Pfadi schon seit ewigkeiten durchfhrt beim Bi-Pi Feuer wird der Letzte Brief von Bi-Pi vorgelesen und der Rest ist relativ Frei. Dennoch gibt es viele Regeln die eingehalten werden mssen.</p><p>-Es besteht aus einem Inneren und einem ausseren Steinkreis</p><p>-Die untersten zwei Hlzer sind nach der Nord-Sdachse ausgerichtet</p><p>-Das Feuer darf nur mit einer Fackel oder einer glhenden Kohle angezndet werden</p><p>-Am Anfang wird ein Feuerwchter bestimmt der das Feuer entfacht</p><p>-Nur der Feuerwchter darf in den 2. Steinkreis hinein und auch nur wenn er einen Stein entfernt</p><p>-Die Kohle wird direkt nach dem Anznden in das Feuer gelegt</p><p>-Das Feuer muss ausbrennen und darf nicht ausgelscht werden</p><p>-Wenn die Glut ausgekhlt ist bekommen alle anwesenden ein bisschen Kohle die sie dann im nchsten Bi-Pi Feuer wieder verwendet werden knnen. So brennt das Feuer immer weiter</p>', NULL, '2022-02-04 23:01:56', '2022-02-04 23:02:03', 0, '3a94193d3f6e'),
	('fb2757b5cf60', NULL, '<p>Wir bilden Gruppen in denen wir die einzelnen Lagerbauten wieder korrekt versorgen.</p><p>Gruppe eins: Schlafzelte</p><p>Gruppe zwei: Aufenthaltszelt + Latrine</p>', NULL, '2022-02-04 23:04:08', '2022-02-04 23:04:16', 0, 'ac207e1f00cb'),
	('f21f14c10c93', NULL, '<p>14:44 BUS 520 15613 Richtung Zrich Flughafen, Bahnhof /nach Zrich Flughafen, Bahnhof /Ankunft 14:55</p><p>15:01 Zug S 16 19657 Richtung Herrliberg-Feldmeilen / nach Zrich Oerlikon, Gleis 6 /Ankunft 15:05</p>', NULL, '2022-02-04 23:04:52', '2022-02-04 23:04:57', 1, '8fc6eca9bc8a');
